INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 4, 0.0, 24015, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 1, "カオリ（サマー）", 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 4, 4.0, 24016, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 2, "カオリ（サマー）", 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 1, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 4, 0.0, 24017, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 3, "カオリ（サマー）", 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 1, 5.2, 24018, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 4, "カオリ（サマー）", 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 2, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 5, 4.2, 24019, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 5, "カオリ（サマー）", 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 6, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 2, 0.0, 24020, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 6, "カオリ（サマー）", 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 1, 6.4, 24021, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 7, "カオリ（サマー）", 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 6, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 2, 0.0, 24022, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 8, "カオリ（サマー）", 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 6, 10.08, 24023, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 9, "カオリ（サマー）", 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 3, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 1, 5.0, 24024, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 10, "カオリ（サマー）", 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 2, 110501);
INSERT INTO `v1_6c031190c72116644994087fd38e2fae0e8870548437f56d14ac13527ce71ff0` VALUES (0.0, 2, 0.0, 24025, "2030/12/17 14:59:59", 10021, "2019/07/31 12:00:00", 24, 11, "カオリ（サマー）", 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 110501);
